import React, { useEffect, useState } from 'react';

const Meal = () => {
    const [meal, setMeal] = useState([]);

    useEffect(() => {
        fetch(`https://www.themealdb.com/api/json/v1/1/search.php?f=a`)
            .then(res => res.json())
            .then(data => setMeal(data.meals))
    }, [])
    return (
        <div>
            <h1>Total Meal : {meal.length}</h1>
        </div>
    );
};

export default Meal;
